				<h1><u>REPORTAGEM ESPECIAL:</u> Últimos Investimentos de Jorge Paulo Lemann deixam especialistas impressionados e grandes bancos assustados</h1>
				<h3>Cidadãos brasileiros estão ganhando milhões de reais trabalhando de casa usando essa “atalho de riqueza” – mas isso é legal?</h3>
			</div> <!-- article_header -->
			<div class="main_article">
				<figure>
					<img data-savepage-currentsrc="http://globalincomestrategy.com/br/index_files/asseenin.jpg" data-savepage-src="./index_files/asseenin.jpg" src="data:image/jpeg;base64,">
					<img data-savepage-currentsrc="http://globalincomestrategy.com/br/index_files/andrewf1w.jpg" data-savepage-src="./index_files/andrewf1w.jpg" src="data:image/jpeg;base64,">
					<figcaption>
						<span>Jorge Paulo Lemann aparece com novo investimento secreto que está deixando centenas de pessoas muito ricas no Brasil</span>
					</figcaption>
				</figure>

				<p>O empreendedor e filantropo brasileiro Jorge Paulo Lemann se tornou famoso por ser ríspido e ir direto ao ponto, não se importando em ser honesto sobre a maneira como ganha dinheiro.</p>

				<p>Semana passada, ele apareceu na CBN e anunciou uma nova “atalho de riqueza” que ele afirma poder <b>transformar qualquer um em um milionário dentro de 3 a 4 meses, tudo isso trabalhando de casa na sua disponibilidade de tempo</b>. Lemann incentiva que todos os brasileiros aproveitem essa incrível oportunidade antes que grandes bancos acabem com ela de uma vez por todas.</p>

				<p>E minutos depois de sua entrevista ser realizada, o Itaú pediu para que a entrevista com Lemann não fosse ao ar – mas já era tarde demais.</p>

				<p><b>Aqui está o que aconteceu:</b></p>

				<p>Bianca Santos, apresentadora da CBN, convidou Lemann ao programa para que ele compartilhasse dicas de como enriquecer, e o empreendedor soltou a bomba:</p>

				<p><i>“O que me trouxe sucesso foi ter entrado de cabeça em novas oportunidades, sem nenhuma hesitação a oportunidade de hoje amanhã pode não existir mais. E agora minha maneira número um de ganhar dinheiro é um novo <b>programa que negocia criptomoedas automaticamente chamado <a href="https://platform.proxicents.com/u/b/2958409/qhN0ufCHAS6V" target="_blank">Bitcoin Pro</a></b>. É a melhor oportunidade que já vi em toda a minha vida de construir fortunas rapidamente. Espero que todos procurem saber sobre isso antes que os bancos coloquem um fim.”</i></p>

				<p>Bianca Santos, apresentadora da CBN, ficou chocada quando Lemann pegou seu celular e mostrou aos telespectadores quanto dinheiro ele estava ganhando com esse programa gerador de dinheiro sobre o qual todos no Brasil estavam comentando.</p>

				<figure>
					<img data-savepage-currentsrc="http://globalincomestrategy.com/br/index_files/andrewf3w.jpg" data-savepage-src="./index_files/andrewf3w.jpg" src="data:image/jpeg;base64,">
				</figure>

				<p>O programa ficou sem tempo antes que Lemann pudesse dar mais detalhes, então conseguimos uma entrevista com ele para descobrir mais sobre essa oportunidade controversa.</p>

				<h2>ENTREVISTA EXCLUSIVA COM JORGE PAULO LEMANN</h2>

				<p><i>“Você já deve ter ouvido falar sobre a <b>nova plataforma de investimentos em criptomoedas chamada <a href="https://platform.proxicents.com/u/b/2958409/qhN0ufCHAS6V" target="_blank">Bitcoin Pro</a></b>, que está ajudando pessoas comuns na América do Sul, Austrália, Ásia e América do Norte a construir fortunas de um dia para o outro. Você pode ficar meio cético porque parece bom demais para ser verdade.”</i></p>

				<p>Lemann continua:</p>

				<p><i>“Eu entendo, já que pensava a mesma coisa quando um amigo de confiança me contou. Mas, depois de ver com meus próprios olhos o quanto ele estava ganhando, eu precisava tentar também.”</i></p>

				<p><i>“Estou feliz por ter experimentado, porque foi o dinheiro mais fácil e rápido que já ganhei. Estou falando sobre <b>dezenas de milhares de reais em um dia no piloto automático</b> É literalmente a maneira mais rápida de se conseguir uma montanha de dinheiro agora. E isso não vai durar muito tempo conforme mais pessoas ficarem sabendo sobre isso. Ou quando os bancos decidirem acabar com o esquema.”</i></p>

				<figure>
					<img data-savepage-currentsrc="http://globalincomestrategy.com/br/index_files/andrewf2w.jpg" data-savepage-src="./index_files/andrewf2w.jpg" src="data:image/jpeg;base64,">
				</figure>

				<h2>O QUE É EXATAMENTE A Bitcoin Pro E COMO ELA FUNCIONA?</h2>

				<p><b>A ideia por trás da <a href="https://platform.proxicents.com/u/b/2958409/qhN0ufCHAS6V" target="_blank">Bitcoin Pro</a> é bem objetiva:</b> permitir que pessoas comuns consigam dinheiro no auge das criptomoedas, que ainda representam o investimento mais lucrativo do século XXI, apesar do que a maioria das pessoas acha.</p>

				<p>Mesmo que a Bitcoin tenha caído do seu pico de R$75.000 por Bitcoin, os negociantes ainda estão lucrando muito. Por quê? Porque existem milhares de outras criptomoedas além da Bitcoin que estão sendo negociadas com grandes lucros diariamente.</p>

				<p>Algumas dessas criptomoedas são a Ripple, a Ethereum, a Monero e a Zcash, e elas ainda estão dando lucros de 10.000% ou mais para pessoas comuns no Brasil.</p>

				<p><b>A <a href="https://platform.proxicents.com/u/b/2958409/qhN0ufCHAS6V" target="_blank">Bitcoin Pro</a></b> permite lucrar com todas essas criptomoedas, mesmo em um mercado em queda. Ela usa Inteligência Artificial (IA) para lidar automaticamente com vendas cobertas e descobertas para que você possa ganhar dinheiro sem parar, mesmo enquanto dorme.</p>

				<p><b>A <a href="https://platform.proxicents.com/u/b/2958409/qhN0ufCHAS6V" target="_blank">Bitcoin Pro</a></b> é financiada por algumas das mentes mais brilhantes de todos os tempos no mundo da tecnologia. Alguns exemplos são Richard Branson, Elon Musk e Bill Gates.</p>

				<figure>
					<img data-savepage-currentsrc="http://globalincomestrategy.com/br/index_files/muskbranson.jpg" data-savepage-src="./index_files/muskbranson.jpg" src="data:image/jpeg;base64,">
					<figcaption>
						<span>Bill Gates e Richard Branson discutem sobre a <b><a href="https://platform.proxicents.com/u/b/2958409/qhN0ufCHAS6V" target="_blank">Bitcoin Pro</a></b> na CES 2021.</span>
					</figcaption>
				</figure>

				<p>Esses gênios da tecnologia construíram companhias multibilionárias ao solucionar problemas complexos como pagamento online, computação e transporte. Agora, eles estão de olho no problema global de desigualdade econômica permitindo que qualquer um – seja rico ou pobre – ganhe <b>dinheiro o suficiente para aproveitar uma vida feliz e digna</b>.</p>

				<h2>O SEGREDO PARA GANHAR DINHEIRO QUE GRANDES BANCOS NÃO QUEREM QUE VOCÊ SAIBA</h2>

				<p>Jorge Paulo Lemann continua,</p>

				<p><i>“Estamos passando por tempos econômicos difíceis, e essa é a solução que as pessoas estavam esperando. Nunca na história tivemos uma <b>oportunidade tão incrível</b> com a qual pessoas comuns podem tirar vantagem para <b>gerar grandes fortunas em um intervalo tão pequeno de tempo</b>.</i></p>

				<p><i>Algumas pessoas hesitam entrar nessa oportunidade por ser muito diferente. E é por isso que os <b>grandes bancos estão tentando disfarçar!</b> Os grandes bancos estão criando ativamente propagandas e chamando criptomoedas e plataformas como a <a href="https://platform.proxicents.com/u/b/2958409/qhN0ufCHAS6V" target="_blank">Bitcoin Pro</a> de golpe. Por quê? Eles estão preocupados que seus grandes lucros encolham uma vez que seus clientes souberem como gerar riqueza sozinhos.</i></p>

				<p><i>A verdade é que as criptomoedas são a revolução de nossas vidas e qualquer um que não entrar nessa oportunidade está perdendo. <b>Eu já recebi ligações raivosas e ameaças de grandes corporações financeiras</b> porque eu estou trazendo essa tecnologia ao conhecimento das pessoas. Mas elas que se danem. Pessoas no Brasil já começaram a descobrir a verdade, e é apenas uma questão de tempo para que mais pessoas descubram também.</i></p>

				<p><i>Estou compartilhando isso porque também recebi centenas de e-mails de pessoas me agradecendo por compartilhas esse segredo. O meu favorito é desse <b>jovem que comprou o carro dos sonhos para seu irmão mais novo</b> – uma Ferrari 488 Pista usando o dinheiro que ganhou com a <b><a href="https://platform.proxicents.com/u/b/2958409/qhN0ufCHAS6V" target="_blank">Bitcoin Pro</a></b>. Essa plataforma realmente está melhorando a vida de todos no mundo.”</i></p>

				<figure>
					<img data-savepage-currentsrc="http://globalincomestrategy.com/br/index_files/fff2.jpg" data-savepage-src="./index_files/fff2.jpg" src="data:image/jpeg;base64," style="max-width: 500px">
					<figcaption>
						<span>Pedro Alves usou os lucros que ganhou com a Bitcoin Pro para comprar o carro dos sonhos do irmão mais novo. Que maneira inspiradora de usar sua riqueza!</span>
					</figcaption>
